INSERT INTO `wy_arlist` VALUES (27,2,'聚合通公众号维护通知','<p>\r\n	接央行最新通知，年底清查所有三方支付商户，凡是涉嫌违规的商户我们有权取消商户支付权限！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	公众号支付通道目前维护中，恢复时间请关注官方公告信息！\r\n</p>\r\n<p>\r\n	给您带来的不便，敬请谅解！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>',1,'100','',1513839298,1),(34,2,'关于央行整顿微信支付的最新通知','<p>\r\n	各商户通知：\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp;接央行通知所有三方支付平台进行微信支付整顿调整，目前本平台微信wap支付进行维护，将于1月10日左右恢复，给您带来不变敬请谅解！\r\n</p>',1,'100','',1515076052,1),(30,2,'关于微信H5支付通道恢复的通知','由于微信官方及央行年底清查所有三方支付平台，给大家造成微信支付交易难的问题，目前我司正在积极恢复，预计微信H5支付通道将于元旦过后开放，请所有商户做好上量准备!',1,'100','',1514607822,1),(31,2,'关于代付手续费调整的通知','因平台业务量大增，公司运维部门决定即2018年1月1日起每笔代付无论金额大小增加5元手续费！望所有商户知晓！',1,'100','',1514686010,1),(32,2,'紧急公告','<p>\r\n	各商户通知：\r\n</p>\r\n<p>\r\n	由于2日0点-3日0点系统代付通道进行升级维护，暂停提现打款，于1月4日下午2点恢复打款！请各商户知晓！\r\n</p>',1,'100','',1514825070,1),(33,2,'代付通道恢复和商家交易量调整通知','<p>\r\n	各位商户：\r\n</p>\r\n<p>\r\n	平台代付功能提前升级完毕，可以正常使用代付功能，聚合通致力于打造良好的口碑，为广大商家提供最优质的服务，如果遇到任何问题，请与官方客服联系！\r\n</p>',1,'100','',1514965140,1),(36,2,'关于平台的一些问答，商户必看','<p>\r\n	1、<span style=\"color:#E53333;\">问：商户交易资金</span><span style=\"color:#E53333;\">多久可以结算提现，T+1到账是什么意思？</span> \r\n</p>\r\n<p>\r\n	答：当天的交易资金将在次日下午就可以进行提现，<span style=\"color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">T+1，就是在星期1到星期5是工作日，星期1，2，3，4交易了第2天到，星期5交易的要下星期1到。星期6和星期7不到账！</span> \r\n</p>\r\n<p>\r\n	2、<span style=\"color:#E53333;\">问：商户提现多久可以到账？</span> \r\n</p>\r\n<p>\r\n	答：商户提现后，平台审核通过，资金将在2小时内到账\r\n</p>\r\n<p>\r\n	3、<span style=\"color:#E53333;\">问：为什么现在到账时间这么久？</span> \r\n</p>\r\n<p>\r\n	答: &nbsp;因为年底央行对所有支付平台执行了管制，凡是有异常交易的平台，央行将会停牌处理。所以，本平台是为了能够长久发展考虑，提现将在订单审核后的12小时内到账！\r\n</p>\r\n<p>\r\n	4、<span style=\"color:#E53333;\">问：我们的交易资金安全吗？</span> \r\n</p>\r\n<p>\r\n	答：资金没有必要担心，我们平台是和国内各大银行合作的！\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>',1,'100','',1515239691,1),(37,2,'今晚20点30分严查违规商户','<p>\r\n	各位商户：\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; 平台今晚8点30分联合经侦部门对平台所有商户进行抽查，凡是违法、违规的商户，平台将关停商户，资金将冻结处理！望所有商户和平台一起共同打造安全的互联网支付平台！\r\n</p>',1,'100','',1515327451,1),(38,2,'关于银联H5支付接口维护通知','<p>\r\n	各位商户：\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; 接中国银联及银监部门的紧急通知，1月22日晚10点后银联H5支付通道暂时维护，恢复时间另行通知！\r\n</p>',1,'100','',1516628544,1),(39,2,'微信H5支付上线的通知','<p>\r\n	各位商户：\r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; &nbsp; 平台微信H5支付将于1月25日左右恢复使用！请所有商户做好对接准备！\r\n</p>',1,'100','',1516628668,1),(40,2,'代付升级维护通知','<p>\r\n	各位商户：\r\n</p>\r\n<p>\r\n	由于平台结算系统需在进行25日中午12点至26日中午12带你升级更新，更新升级后，提现可执行代付到账！给您带来不便敬请谅解！\r\n</p>',1,'100','',1516850237,1),(6,1,'如何加盟我们？','<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;font-family:\" line-height:22.4px;\"=\"\">1：注册<span style=\"white-space:normal;\">聚合通</span>商户，如果您没有帐号，请先注册！</span> \r\n	</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;font-family:\" line-height:22.4px;\"=\"\"><span style=\"box-sizing:border-box;margin:0px;padding:0px;\">2：</span><span style=\"box-sizing:border-box;margin:0px;padding:0px;\">注册成功后下载表格，填写申请实名认证资料。</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">（1）个人申请认证：只需提供身份证</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">（2）企业申请认证：需提供营业执照和法人身份证</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">3：提交实名认证：等待我们工作人员对您的实名进行认证，一般10分钟内完成认证！</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">4：商户入网：提交您的网站域名，我们将对您的网站进行审核，审核期间必需保证您的网站能正常打开，否者将会被拒绝。</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">5：域名开通：审核通过后，即可获取商户号和Key码。</span><br style=\"box-sizing:border-box;\" />\r\n<span style=\"box-sizing:border-box;margin:0px;padding:0px;\">6：集成支付接口：获取Key码，您可自己集成也可以联系技术帮您协助集成<span style=\"box-sizing:border-box;margin:0px;padding:0px;white-space:nowrap;\"><span style=\"box-sizing:border-box;margin:0px;padding:0px;line-height:22.4px;white-space:normal;\">。</span></span></span></span> \r\n</p>',1,'100','',1489198692,1),(7,1,'商户提现什么时候能到？','<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:\" line-height:22.4px;\"=\"\">T+1提现方案详解</span> \r\n	</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:\" line-height:22.4px;\"=\"\">1、星期一、星期二、星期三、星期四、<span style=\"box-sizing:border-box;margin:0px;padding:0px;line-height:22.4px;\">星期五、星期六、星期日</span>，0点~23点59分59秒间提现的资金将于次日23点前到账。</span> \r\n</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:\" line-height:22.4px;\"=\"\">2、国家法定节假日期间提现的资金将于 节假日后第一个工作日23点前到账。</span> \r\n	</p>\r\n<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;font-family:\" font-size:14px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n	<span style=\"box-sizing:border-box;margin:0px;padding:0px;color:#333333;font-family:\" line-height:22.4px;\"=\"\">3、如果遇到“<span style=\"box-sizing:border-box;margin:0px;padding:0px;white-space:nowrap;\">不可抗力”因素，将延迟结算（具体看网站公告）。</span></span> \r\n</p>',1,'100','',1489198772,1),(9,3,'聚合支付网银通道模式的浅析','<span class=\"Apple-tab-span\" style=\"white-space:pre;\"> </span>聚合通平台聚合了2016开始就很火的银行通道，把很多银行的通道聚合到这个<span style=\"white-space:normal;\">聚合通</span>平台上。<br />\r\n<span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<p>\r\n	<span class=\"Apple-tab-span\" style=\"white-space:pre;\"> </span>银行通道一直很火，现在大大小小的银行都在拥抱移动支付，很多技术提供商也在中间 找准了自己定位，帮助银行接入移动支付。\r\n</p>\r\n<p>\r\n	把多个银行通道聚合起来，并且产品化，便捷地提供服务.\r\n</p>\r\n<span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<p>\r\n	<span style=\"white-space:nowrap;\">先来看看<span style=\"white-space:normal;\">聚合通</span>银行通道的整体模式（点击图片更清晰）：</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><img src=\"/upload/image/20170325/20170325095119_23609.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">聚合平台作为一个通道总发平台，已经集成了现有的多条银行通道，如果有需要，也可以第一时间内迅速对接上市场上出</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">现的新通道。</span><br />\r\n<span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;\"> 对于接入<span style=\"white-space:normal;\">聚合通</span>平台的服务商或者商户而言，他们可以选择在通道之间自由切换，降低银行系统升级、接口关闭等</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">因素对支付产生的影响。</span></span><span style=\"white-space:nowrap;\">而</span><span style=\"white-space:nowrap;\">且由于各个银行通道集成到一个聚合平台，通道之间切换非常迅速。</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"> <span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;\">通常服务商或者商户想自己开通银行通道，都需要耗费大量的人力（雇佣谈判团队）、时间（谈判周期）、资金</span></span><span style=\"white-space:nowrap;\">（谈判所需费用）</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">，并且对服务商</span><span style=\"white-space:nowrap;\">和商户本身的规模有一定的要求。而对于聚合了银行通道的聚合平台来说，这个要求就可以降到最低。</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"> <span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;\">同时使用<span style=\"white-space:normal;\">聚合通</span>搭建收银台系统，可以降低服务商或者商户的成本，包括后期的管理与维护，软硬件设施，</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">以及减少技术人员的投入。</span><br />\r\n<span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;\">移动支付由于规模庞大，“聚合”一直是一个很火的概念。柒付云计费是把各种支付方式聚合到一个平台上，</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">现在奇咖的云计费平台是把各个银行通道</span></span><span style=\"white-space:nowrap;\">聚合到一个平台上。</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"> <span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;\">也许未来还有更多维度的聚合吧！</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">比如说服务商的聚合（现在有大大小小的服务商几千家）？</span></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><span style=\"white-space:nowrap;\">比如说支付流量的聚合？比如说营销平台的聚</span></span><span style=\"white-space:nowrap;\">合？</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"> <br />\r\n</span> \r\n</p>',1,'100','',1458869965,1),(10,3,'“网联”3月底上线测试 单中心逐步统一线上支付清算','<p style=\"text-align:center;\">\r\n	<span style=\"white-space:nowrap;\"><img src=\"/upload/image/20170325/20170325101908_91296.jpg\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><strong> <span style=\"color:#000000;font-size:14px;\"> 记者获悉，落地北京、备受市场高度关注的线上支付清算统一平台，网联将采用一地一中心一个系统，京、沪、</span></strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\"><strong><span style=\"color:#000000;font-size:14px;\">深多个机房的分布式架构。</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>该平台将于本月底进行灰度上线测试。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 中国社科院金融研究所支付清算研究中心特约研究员赵鹞向《财经》记者表示，灰度发布是指在系统之间，能够平滑过渡的一</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>种技术发布方式。</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">AB test就是一种灰度发布方式，让一部分用户继续用A，一部分用户开始用B，如果用户对B没有什么反对意见，</strong>\r\n</p>\r\n<p>\r\n	<strong style=\"font-size:14px;white-space:nowrap;\">那么逐步扩大范围</strong><strong style=\"font-size:14px;white-space:nowrap;\">，把所有用户都迁移到B上面来。灰度发布可以保证整体系统的稳定，在初始灰度的时候就可以发现、调整问题，</strong>\r\n</p>\r\n<p>\r\n	<strong style=\"font-size:14px;white-space:nowrap;\">以保证其影响度。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 据《财经》记者了解，一地一中心一个系统意味着，控制中心和业务中心都在北京，只是机房采用了分布式，因为需要规模比较大，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>所以采用分布式运行处理，这与此前坊间流传的“三地三中心或者两地两中心”说法完全不同。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> “网联是世界上第一个采用分布式架构的超大型网络支付清算设施，由于采用分布式架构，使得其业务处理能力能够水平扩展，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>实现规模经济。网联平台是个初生事物，涉及既得利益调整，我们应该尽力爱护，减少不必要的干扰”赵鹞说。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 中国银行网络金融部副总经理董俊峰此前借调到人民银行支付司，专门牵头筹备网联搭建。据接近该平台人士向《财经》记者透露，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>公司成立之后，董有望担任网联总裁。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 传统清算模式是银联做清算，发卡端在银行，收单在收单机构，互相有一个匹配，加上商户，属于所谓的四方模式。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>不过，在近年支付业务快速发展的过程中，有的支付机构实际上已经做了清算工作，资金托管在银行，形成了独特的三方模式，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>这种模式也推升了支付机构备付金存管极为分散的状态，风险不可忽视。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 据此前央行提供的数据显示，在全国267家支付机构中，支付机构少则大概有10几个备付金存管账户，多则有70多个账户，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>甚至有的多达上百个账户。而且，支付机构备付金的规模快速增长，截至去年底保守估计有5000亿规模。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 对此，人民银行在今年1月13日印发《中国人民银行办公厅关于实施支付机构客户备付金集中存管有关事项的通知》</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>（以下简称“通知”），</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">明确支付机构客户备付金集中存管工作要求，支付机构应将部分客户备付金交存至指定机构专</strong>\r\n</p>\r\n<p>\r\n	<strong style=\"font-size:14px;white-space:nowrap;\">用存款账户，首次交存的平均</strong><span style=\"white-space:nowrap;font-size:14px;\"><strong>比例为20%左右，</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">最终将实现全部客户备付金集中存管。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 据央行支付结算司相关负责人此前介绍，各支付机构首次交存的具体比例根据业务类型和分类评级结果综合确定，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>评级较高的机构缴纳的备付金比例较低一些。备付金集中存管政策在今年4月17日正式开始，交存金额根据上一季度客户备付</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>金日均余额计算，</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">每季度调整一次。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 某接近央行人士表示，网联和备付金集中管理是配套的，网联是为集中存管做基础准备，因为备付金集中存管需要一个平</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>台作</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">为支撑。“网联</strong><strong style=\"font-size:14px;white-space:nowrap;\">是希望把清算单独拿出来，提高存管透明度。”</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 上述接近央行人士表示，在支付模式中，网关模式已很少使用，快捷支付和第三方支付账户模式大概各占一半，那么，支</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>付账户模式仍然属于</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">封闭的三方模式，网联解决的问题是不让支付机构与银行直连，解决的是快捷支付问题。其实，快捷</strong>\r\n</p>\r\n<p>\r\n	<strong style=\"font-size:14px;white-space:nowrap;\">支付规模也很大，例如</strong><span style=\"white-space:nowrap;font-size:14px;\"><strong>红包资金来源有零</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">钱和银行卡，银行卡部分就属于快捷支付了。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 据了解，网联系统是筹备人员自建系统，与银联系统有一定相似性。而目前支付机构业务量规模较大，如果全部接入网联</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>系统对其也是一个考验，</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">所以，测试之初接入支付机构的业务量不会太大，通过逐步认证，再一步步接入。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 而对于试用阶段的收费情况，知情人士表示还没有收费策略还没有定。相比银联，接近央行人士认为，网联做的更多是增</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>量部分，与银联也会有一定竞争</strong></span><strong style=\"font-size:14px;white-space:nowrap;\">但是竞争不是坏事，市场这么大，如果形成良性竞争也有利于这个行业健康发展。</strong>\r\n</p>\r\n<p>\r\n	<br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 此前，央行副行长范一飞曾表示，“网联”的定位是公共属性、安全性、便利性，鼓励创新和公平竞争，</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>目的是提高支付机构的清算效率、交易留痕、资金可追溯、风险可控。</strong></span><span style=\"white-space:nowrap;\"><br />\r\n</span><br />\r\n<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong> 数据显示，2016年中国第三方互联网支付交易规模达到19万亿元，同比增长62.2%。同比增速较去年46.9%的增速有着较</strong></span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;color:#000000;font-size:14px;\"><strong>大幅度的提升。</strong></span><strong style=\"white-space:nowrap;\"><span style=\"font-size:14px;\">2016年中国第三方移动支付交易规模预计达到38万亿元，同比增长215.4%，同比增速较2015年的103.5%</span></strong>\r\n</p>\r\n<p>\r\n	<strong style=\"white-space:nowrap;\"><span style=\"font-size:14px;\">大幅提升。</span></strong>\r\n</p>\r\n<p>\r\n	<strong></strong> \r\n</p>',1,'100','',1490408302,1),(11,3,'支付机构交存备付金倒计时 交存细节进一步明确','<p>\r\n	<img src=\"/upload/image/20170325/20170325102656_36191.jpg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		对支付机构“小金库”（客户备付金）的集中存管正式进入倒计时。3月23日，两家支付机构向北京商报记者证实，在年初央行发布备付金存管通知后，日前接到央行下发的《支付机构将部分客户备付金交存人民银行操作指引》（以下简称《指引》），重申交存的“大限”为今年4月17日，并对支付机构交存备付金进行了操作层面的明确和细化。“备付金存管就要来了。”一位支付机构人士感叹道。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"color:#B22222;\"><strong>交存细节进一步明确</strong></span> \r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		根据一家支付机构提供的《指引》内容显示，自4月17日起，支付机构暂通过商业银行将部分客户备付金交存至人民银行。支付机构应当指定法人所在地备付金存管银行的分支机构作为交存银行，由交存银行在所在地人民银行分支机构开立专用存款账户办理客户备付金交存业务。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		与1月13日央行发布的《中国人民银行办公厅关于实施支付机构客户备付金集中存管有关事项的通知》（以下简称《通知》）相比，《指引》明确了交存给谁，以及账户开在哪里。彼时《通知》只提到，支付机构应将客户备付金按照一定比例交存至“指定机构专用存款账户”，该账户资金暂不计付利息。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		对于业内关心的交付比例，此前《通知》已提出，按照网络支付业务、银行卡收单业务、预付卡发行与受理业务三类，支付机构应该交存客户备付金执行10%-24%不等的比例，获得多项支付业务许可的支付机构，从高适用交存比例。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		此外，《指引》还明确，首次应交存客户备付金金额的计算公式为“首次应交存备付金金额＝上季度客户备付金日均余额×适用的交存比例”。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		一家大型支付机构的人士对北京商报记者表示，目前实施的交存比例对机构的日常经营影响尚不是很大。易观支付分析师王蓬博进一步指出，交存备付金会影响支付企业利润收益，但他也认为，对于大的支付机构来讲影响不大，对于中小支付机构，特别是预付卡机构影响会相对大一些。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"color:#B22222;\"><strong>整肃风险隐患</strong></span> \r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		客户备付金是非银行支付机构预收其客户的待付货币资金，不属于支付机构的自有财产。中国人民大学重阳金融研究院客座研究员董希淼举例称，“比如我们在网上购买商品后，支付的货款在收到货并且做出确认之前，一直会存在支付机构的账户上，这部分沉淀的资金就是备付金。”\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		随着以支付宝和微信支付为代表的第三方支付机构的崛起，用户在虚拟“钱包”中留存的余额数目越来越大，第三方支付机构的“备付金”口袋也越来越鼓。央行有关负责人表示，截至2016年三季度，267家支付机构吸收客户备付金合计超过4600亿元。另据估算，目前这一数字可能突破5000亿元。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		央行早在2010年6月下发的《非金融机构支付服务管理办法》中就提出，不得挪用客户备付金是非金融机构支付业务的一条红线。但越来越多的沉淀资金，让不少支付机构萌生了挪用的贪念，像银行那样依靠“吃息差”来盈利。有业内人士计算，如果每笔交易给支付机构带来的资金沉淀期是7天，即便按照活期利息0.35%推算，备付金每年产生的额外收益能达到14亿元。对一些中小支付机构而言，备付金的利息为它们贡献了80%的年收益，俨然成为机构的“小金库”。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		交存备付金无疑是断了不少中小支付机构的“财路”。央行表示，祭出“大招”的背后，是因近年第三方支付备付金管理屡次爆发风险事件。例如在2014年下半年，浙江易士企业管理服务有限公司、广东益民旅游休闲服务有限公司和上海畅购企业服务有限公司3家支付机构，都被查出大量挪用备付金。其中上海畅购企业服务有限公司挪用客户备付金造成资金风险敞口达7.8亿元，涉及持卡人超过5万人。这三家支付机构目前都已经被吊销了支付牌照。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"color:#B22222;\"><strong>行业并购或提速</strong></span> \r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		央行的整肃才刚刚开始，备付金的交存比例并不会一直停留在当前的20%左右。央行在《通知》中就已明确，“最终将实现全部客户备付金集中存管”。在王蓬博看来，备付金存管有两方面作用，除了保证客户备付金安全，也是为“网联”的推出扫清障碍。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		“网联”是业内对央行牵头成立的线上支付统一清算平台的简称，去年以来，“网联”即将成立的消息不时传出，它将切断“第三方支付绕开独立清算机构直连银行”的模式，统一建立一个线上的清算平台，不仅大幅缓解支付机构重复投入的问题，也符合支付与清算分开的监管要求。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		王蓬博表示，未来如果支付机构的备付金都实行统一集中存管，第三方支付机构将无法直连银行。在“网联”成立以后，监管机构势必推动支付清算合规化，第三方支付机构要么接入银联网上清算系统，要么通过“网联”进行资金清算。因此，也可以说备付金存管是为“网联”的推出扫清了障碍，为支付清算合规化进一步扫清了障碍。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		不过，中央财经大学中国银行(3.610, 0.01,0.28%)业研究中心主任郭田勇认为，初期央行担心小型支付机构出问题，给机构的“小金库”加强监管是有必要的。未来按照市场化的方向，对支付机构应该有划分，大型机构是为了干出一番事业，跑路几率很低，相对信誉度比较高，央行不必要“一刀切”。\r\n	</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		但即使央行对所有机构采取了同样的政策，当支付机构回归纯粹的业务本源后，不少业内人士认为，支付行业的“马太效应”也会加剧，或倒逼一些中小机构退出市场。零壹财经财经分析师孙爽和郭竞指出，第三方支付机构的创收方式主要包括客户备付金利息收入、手续费和给商户导流收入等。新政实施后，第三方支付机构的创收方式将更依赖非息收入。此前，支付宝和微信支付已经推行“提现收费”政策，可获取手续费，且客户对其有较高的黏性，但很多小的第三方支付机构并没有这样的条件，如此一来，行业“马太效应”将会加剧，即强者愈强弱者愈弱。\r\n</p>\r\n<p style=\"font-family:微软雅黑, \" font-size:16px;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		“支付行业的产品和模式创新将加速，支付行业将迎来一波合并潮，支付牌照价值降低，出清速度将加快。”王蓬博表达了同样的观点。\r\n	</p>\r\n	<p>\r\n		<br />\r\n	</p>',1,'100','',1490408659,1),(12,3,'央行约谈蘑菇街等企业支付牌照“高烧”难退','<p style=\"padding:0px;list-style:none;font-size:14px;color:#666666;font-family:&quot;white-space:normal;text-indent:2em;\">\r\n	&nbsp; &nbsp; 近日，有消息称以蘑菇街（某电商平台）、二维火（餐饮云收银系统研发和应用的服务商）等为代表的电商服务平台由于在实际开展业务过程中使用了“二清”模式，在近半年间陆续接受了央行的约谈调研和窗口指导。<br />\r\n&nbsp; &nbsp; 3月22日，蘑菇街、二维火的相关负责人接受《中国经营报》记者采访时均表示：目前业务合规，不存在资金存留和违规问题。<br />\r\n近年来，随着移动互联网飞速发展，互联网企业业务交易规模不断扩大，一些互联网巨头为规避合规性问题，以及实现交易闭环的形成和用户数据的掌控，纷纷重金出手收购支付牌照。<br />\r\n&nbsp; &nbsp; 然而，在第三方支付公司从业人士李先生看来，一方面，“天价”的支付牌照令众多电商、商旅等互联网平台望而却步；另一方面，平台出于资金沉淀收益，以及运营角度考虑，某种程度上并不是十分愿意通过第三方支付来解决一些合规性问题。<br />\r\n电商平台现支付合规性问题<br />\r\n&nbsp; &nbsp; 根据《经济观察报》报道，以蘑菇街、二维火等为代表的电商服务平台在近半年间陆续接受了央行的约谈调研和窗口指导。<br />\r\n该报道称，根据接近央行人士透露，包括蘑菇街、二维火等在内的电商类平台在实际从事业务的过程中使用的是“二清”模式。眼下央行各地的中支机构都在约谈此类电商，但央行窗口指导并非是针对这几家企业，而是认为对这些企业现有的模式进行监管探路具有非常好的典型意义。<br />\r\n&nbsp; &nbsp; 对于央行的这次约谈，业内人士均认为属于正常的行业了解，不过上述电商类平台有可能存在“二清”等违规行为。<br />\r\n传统的“一清”和“二清”一般属于POS收单业务范畴。所谓“二清”公司，是针对“一清”机构而言。“一清”机构的POS机一般通过银联、银行或者第三方支付公司直接清算，商户的交易结算款会直接划转至商户的收款账户。而“二清”公司的POS机需进行二次清算，即结算资金经过一次清算后，先转至“二清”公司开立的第三方账户，经由该第三方账户处理后，再结算至商户的收款账户。简单地说，“二清”公司的业务未获得央行支付业务许可，却在持牌收单机构下实际从事支付业务，属于违规行为。“二清”可能造成平台资金存留，进而产生跑路风险。<br />\r\n&nbsp; &nbsp; 对于电商平台来说，“二清”意味着用户的购物款没有直接打给在平台开店的卖家，而是直接存在电商平台的虚拟账号里，待买家收货后平台才将款项打给卖家，这期间大概会有3~7天的账期，这便造成资金存留。上述第三方支付公司人士李先生分析道：“合规与否实际上主要是看购物款是不是直接打到商户手里。”<br />\r\n&nbsp; &nbsp; 关于合规性问题，此前蘑菇街相关负责人接受媒体采访时曾表示：“企业到达一定规模时，蘑菇街确实在业务层面形成了一定的资金存留。在跟央行沟通之后蘑菇街也意识到了这个问题，也明白监管层的忧虑。在这半年的时间里系统已经与支付宝合作进行了系统改造，解决了合规性的问题。”<br />\r\n&nbsp; &nbsp; 3月22日，蘑菇街相关负责人接受《中国经营报》记者采访时表示：“蘑菇街目前是完全合规的，之前有些报道存在一些误解。”同时其表示，正在与央行一起探讨服务创新方面，并由监管部门把握大方向。<br />\r\n&nbsp; &nbsp; 此外，二维火高管也表示：“实际上不是央行约谈我们，而是去年公司一个面向C端的新业务上线，我们主动登门拜访央行，咨询新产品是否合规。二维火早在去年7月通过和银行合作更换了新系统，平台并不经手资金，也就不存在资金存留和违规问题。”<br />\r\n在柒付看来，规避合规问题一般来讲有三种解决方案：第一，货款直接从买家打到商户手里；第二，直接购买第三方支付牌照；第三，平台没有第三方支付资质，但资金沉淀可以在银行，也可以在第三方支付公司开户，把资金沉淀在第三方支付公司，让第三方支付公司帮它做资金沉淀和分发。<br />\r\n“解决合规性问题的唯一办法就是接入支付渠道，不管是银行的还是第三方支付机构的。”易观金融中心分析师王蓬博告诉本报记者。<br />\r\n然而，“一方面，‘天价’的支付牌照令众多电商、商旅等互联网平台望而却步；另一方面，鉴于资金沉淀带来的收益，以及从运营角度考虑，平台希望所有交易端信息在自己平台上发生，进而掌控用户数据提供更好的服务，实际平台某种程度上并不是十分愿意通过第三方支付来解决一些合规性问题。”李先生说道。<br />\r\n支付牌照价格或继续飙升<br />\r\n近年来，包括BAT（百度、阿里、腾讯）在内，京东、小米、唯品会、美团、国美、苏宁和万达等，纷纷投入重金购买支付牌照或者并购第三方支付公司。<br />\r\n公开资料显示，京东收购网银在线，小米收购捷付睿65%股权，唯品会收购浙江贝付，美团点评完成对钱袋宝的全资收购，万达收购快钱68.7%股权等等。<br />\r\n根据业务类型的不同，支付牌照的价格也从几千到二十多亿元不等。作为居间方，北京米塔管理咨询有限公司副总经理张桁梽透露，去年10月底，互联网业务的支付牌照市场报价一般都在5亿元左右了，三项业务的牌照约在7亿元左右，而且这些价格都不含央行备付金和居间费用。张桁梽表示：“单个预付卡受理业务牌照比较便宜，现在价值比较高的是互联网支付业务牌照。”<br />\r\n据悉，目前在全国已经发放的260多张支付牌照中，很多并没有开展实际业务。“现在央行一直不批新牌照，而且还会削减市场上的牌照数量，所以总体上来说价格还会一路上涨。具体的交易价格还是要看标的公司的具体情况，比如有没有业务，有没有负债，到期日等。”张桁梽告诉记者。<br />\r\n在从事支付行业十余年的北京金开门信息技术有限公司CEO张国雄看来，大量牌照在持有者手里并没有产生任何价值，这也是央行支持巨头互联网企业通过收购方式获牌的原因之一，“因为这项业务权利很大，价值也很大，央行希望每张牌照发出去之后能够得到合理运用。”<br />\r\n在王蓬博看来，收购支付牌照的意义有三方面：首先，能够让企业合规的沉淀资金；其次，能够让企业在此基础之上增加理财等多种形式的增值服务；第三，因为支付是交易闭环的原因，拥有支付牌照的企业能够掌握交易过程中的信息流、支付流和资金流等，在获得此类离交易场景最近的数据基础之上，不但可以对C端做好用户画像描述，对B端的需求也能掌握，进而推出更多产品占领市场。<br />\r\n而二维火高管则指出：尽管和银行合作会略微增加一点成本，每次交易银行会收取一定的服务费；但毕竟有效地规避了法律风险，杜绝了监管层担心的金融事故，而且和收购支付牌照相比，这个成本低太多。<br />\r\n</p>',1,'100','',1490487047,1),(13,3,'支付牌照热炒之下的背后，支付行业正等待涅槃重生','<p style=\"text-align:center;\">\r\n	<img src=\"/upload/image/20170326/20170326101838_67897.jpeg\" alt=\"\" /> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\">\r\n		2014 年的一篇预言帖《不做支付的巨头，不是好的生态系统》，在 2015 年得到验证。2015 年的一篇预言帖《未来一年，中国的移动支付市场会是什么样》，在 2016 年几乎全面命中。其中「大量支付公司被战略投资或者被兼并收购」这一观点被多次验证：美团收购钱袋宝，唯品会收购浙江贝付；近日，滴滴将全资收购持牌机构一九付的消息喧嚣尘上。\r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">很多人怂恿我说 2016 年要不要再写一篇，看看 2017 年会怎样？在 2016 年 9 月的一个周末，一篇从 2017 年一直到 2019 年的预言文章出炉了。但在最后一刻我还是放弃公布出来，当时的心态是既然看得这么准，干嘛提前告诉别人呢？闷声发大财不是更好吗？</span> \r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">但随着时间步入 2017 年，我内心却有一丝丝担忧。各种迹象表明，2016 年那篇密而不发的文章里担忧的事情，比想象中到来的更快。所以这篇文章标题中的”支付行业的涅槃重生“，并不是危言耸听，to live or to die，it is not a question already。</span> \r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\"><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;white-space:normal;\">\r\n	<img src=\"/upload/image/20170326/20170326101856_92177.jpeg\" alt=\"\" /> \r\n</p>\r\n<p style=\"white-space:normal;\">\r\n	<br />\r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\">\r\n			微信从 IM 和社交切入支付如此成功，让人感叹<strong>跨界竞争的威力和可怕之处：挑战你的是不同维度的打击，而你无力还击。</strong>但什么是真正意义上的跨界似乎又没有人说的清楚。我一直以来都信奉一个观点：以行业划分界限的工业时代分工体系是有缺陷的。虽然社会越发展，分工越精细，垂直行业越来越多，但大家能够去竞争的东西始终是有限的，比如消费者的购买力、时间、注意力和认知度。所以看上去<strong>很多的「跨界竞争」在本质上并不跨界，因为它们在一开始就在竞争同样的东西，只不过在行业划分的时候被刻意分属到不同行业罢了。</strong> \r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">所以体育产业跟娱乐产业是可以竞争的。周末是去看 NBA 比赛，还是去看好莱坞大片，对于大多数美国人就是一次消费和时间的选择题。所以外卖行业跟速食行业是可以竞争的。大家叫外卖多了，吃方便面和各种零食的诉求就少了。所以当一家美国 VR 公司喊出口号要干掉旅游行业的时候，我并不意外。</span> \r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <strong style=\"text-indent:2em;\">行业之间的竞争也是一样，大家都在竞争有限的人才和有限的资本的青睐。</strong><span style=\"text-indent:2em;\">当一个行业越有前途（钱途），资本就会进入，同时人才也会到来。于是这个行业就越发强大高速发展，产生了很好的回报，接着更多的资本进入，更多的人才加盟，拥有螺旋上升循环的势能。80 年代的计算机时代，90 年代的互联网时代，都是这样的例子。相反的例子是，一个行业如果无法让资本获得回报，无法让人才获得发展，就会失去他们，从而留下更少的资本和更劣币的从业者，让这个行业举步维艰摇摇欲坠。这又进一步降低这个行业对资本和人才的吸引力，于是恶性循环就开始了。</span> \r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">所以一个行业可以大力发展，是需要有主导者制定更加繁荣的生态策略，需要有足够多的利润去支撑资本和人才的回报。而这些，</span><strong style=\"text-indent:2em;\">在即将到来的 2017 年的支付行业，我是有点隐隐担心的。</strong><span style=\"text-indent:2em;\">如果以手续费为主要商业模式的话，支付行业已经从一个薄利行业到了一个微利行业。在欧美基本 3％ 左右的手续费，在中国整整少了一个数量级，最低可以到 0.1%。即使这样，拼低价抢客户的行为还在疯狂继续。一个没有利润的行业是绝对没法创新的，我指的是积极意义上合规合法的创新。</span> \r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">也许很快就有人要反驳我说：「不对，中国这几年移动支付的发展领先全世界，怎么能说没有创新呢」？原因很简单，</span><strong style=\"text-indent:2em;\">这个行业最大的创新力量不是来自于这个行业本身的盈利模式，而是携带其他行业战利品的「价格补偿」的降维打击。</strong> \r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <strong>所以可以看到的未来是，做社交的入场，做电商的入场，做手机的入场，做物流的入场，做零售的入场，做金融的入场。每一家背后都有很好的现金流业务，不差这千分之几的手续费空间。于是，一个行业的规则，商业模式，生态系统基本被颠覆。</strong> \r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"> <span style=\"text-indent:2em;\">很有可能有一天，支付圈聚会，基本是各行各业的人都有，支付更多是一个技术载体，而不是一个行业生态。再看看美国，银行、卡组织、支付处理商、支付网关、收单机构、代理服务商，这是一个非常完整的行业版图。3% 左右的手续费盈利空间，使得产业链上的每一环都可以坐拥丰厚的利润。虽然有几大巨头竞争，但依然维持着行业的体面和健康。相反，很难想象 Google，Facebook，Mircosoft，Uber 各自拥有一家支付公司排排坐的场景。</span> \r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><strong style=\"text-indent:2em;\">如果不出现大的政策层面的变化，2017 年过后，支付将成为一个真正意义上的底层技术，各行各业都拥有的标配，任何有机会染指生态系统的公司都不会错过的领域。行业的边界就此打破。</strong> \r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><span style=\"text-indent:2em;\">1. 由于手续费会持续走低，原有的商业模式也会坍塌，交易金额的意义会让位于交易笔数，而笔数代表着用户数和频次，这也预示着支付最终会成为一个全新流量入口，基于流量思维的商业模式会成为主流。</span>\r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><span style=\"font-family:&quot;font-size:16px;text-align:justify;text-indent:2em;white-space:normal;background-color:#FFFFFF;\">2. 而从流量思维展开看，「线上」 、「线下」的叫法也将进入历史，未来是属于全渠道的。</span>\r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><span style=\"font-family:&quot;font-size:16px;text-align:justify;text-indent:2em;white-space:normal;background-color:#FFFFFF;\">3. 再当全渠道普及到一定阶段，电子货币就将大行其道，移动支付彻底消灭银行卡和现金也会指日可待。</span>\r\n	</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><span style=\"text-indent:2em;\"><span style=\"color:#404040;font-family:&quot;font-size:16px;text-align:justify;text-indent:32px;white-space:normal;background-color:#FFFFFF;\">4. 可以预见几个主流的支付公司会进一步下沉为基础设施，生态系统将孕育出更多垂直的新机会。</span><br style=\"color:#404040;font-family:&quot;font-size:16px;text-align:justify;text-indent:32px;white-space:normal;background-color:#FFFFFF;\" />\r\n<span style=\"color:#404040;font-family:&quot;font-size:16px;text-align:justify;text-indent:32px;white-space:normal;background-color:#FFFFFF;\">&nbsp;&nbsp;5. 由中国引领的移动支付浪场最终也将席卷全世界，成为中国模式和技术走出去的旗帜。</span><br />\r\n</span>\r\n</p>\r\n<p style=\"margin-top:26px;margin-bottom:26px;padding:0px;font-size:16px;text-indent:2em;color:#404040;font-family:\" text-align:justify;white-space:normal;background-color:#ffffff;\"=\"\"><span style=\"text-indent:2em;\">2017 年，我们会不会见证一个行业的涅槃重生，我们拭目以待。</span>\r\n	</p>',1,'100','',1490493128,1),(14,2,'禁止涉赌、欺诈、钓鱼、赌博、洗钱等接入!','<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">为保障正规用户的利益,再次警告那些涉赌，涉黄，欺诈，钓鱼，洗钱的人.</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">如触犯法律底线我们将直接锁定帐号不做解释.</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">棋牌游戏类，没有文网文批文的一律禁止接入，明知故犯的锁定账号并不结款.</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">以上行为不仅加重系统售后工作量,更严重的是助长了一些不法分子的增长.</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">为了长远发展和良性的经营环境,一经发现,永久停止使用,请珍惜您的账号.</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;line-height:36px;text-indent:20px;color:#393939;font-family:\" font-size:14px;white-space:normal;\"=\"\">\r\n	<span style=\"margin:0px;padding:0px;font-family:微软雅黑, \" font-size:16px;\"=\"\">请各位用户做好售后，相互理解，大吉大利，严查欺诈钓鱼赌博，请自重</span> \r\n</p>',1,'100','',1485513654,1),(15,2,'支付宝异步通知已修复，请放心使用','<span style=\"white-space:nowrap;\">支付宝异步通知已修复请各商户周知！</span>',1,'100','',1490754342,1),(17,3,'\"金融消费者权益日\"宣传手册','一、增强风险识别能力和责任意识\r\n（一）谨防电信网络诈骗，保护好个人信息和资金安全\r\n近年来，电信网络诈骗日益呈现产业链化、高科技化、多渠道化和蔓延化发展趋势，严重危害人民群众财产安全和合法权益，损害社会诚信和社会和谐稳定，已成为影响群众安全和社会和谐稳定的一大公害。按照党中央、国务院统一部署，人民银行积极响应，迅速行动，针对当前一些电信网络诈骗案件暴露出支付环节存在的问题，于2016年9月印发《中国人民银行关于加强支付结算管理 防范电信网络新型违法犯罪有关事项的通知》（银发[2016]261号，一下简称《通知》），从加强账户实名制、阻断电信网络诈骗资金转移主要通道等方面采取20项具体措施，筑牢金融业支付结算安全防线，切实维护社会公众财产安全。\r\n打击防范电信网络诈骗是一项长期性、系统性的工作。在这一过程中，还需要社会公众增强防范意识，提高安全支付技能，更好地保护自身财产安全。社会公众要做到：不轻信来历不明的电话和手机短信，不随意透露自己和家人的身份、存款、银行卡等重要个人信息，不向陌生人转账汇款，发现上当受骗应立即向公安机关报案。同时，要积极了解与个人生产生活切身相关的各项政策措施，例如，自2016年12月1日起，个人通过ATM向非本人同行账户转账汇款的，延迟24小时到账。一方面，如果发现上当受骗，可以向付款账户开户行申请撤销该笔汇款，及时挽回损失；另一方面，要提高警惕，防止诈骗分子通过先骗现金或者交易对手货物，后撤销ATM转账来实现诈骗。\r\n此外，自2017年1月1日起，银行和支付机构对经设区的市级及以上公安机关认定的出租、出借、出售、购买银行账户（含银行卡，下同）或支付账户的单位和个人，组织购买、出租、出借、出售银行账户或支付账户的单位和个人，假冒他人身份或者虚构代理关系开立银行账户或支付账户的单位和个人，5年内停止其银行账户非柜面业务、支付账户所有业务，3年内不得为其新开立账户。同时，人民银行还将上述单位和个人信息移送金融信用信息基础数据库并向社会公布。因此，社会公众要妥善管理好个人身份证件、银行账户和支付账户，不要为蝇头小利而出租、出借、买卖银行账户和支付账户，坚决部位犯罪分子提供作案工具。\r\n（二）养成良好习惯，避免银行卡盗刷\r\n银行卡被盗刷的事件层出不穷，此前，盗刷行为多发于信用卡，如今已逐渐涵盖了几乎所有的银行卡种类。盗刷的手段有很多种，持卡人自己在日常用卡时要提高防范意识，具体可以从以下几个方面加以注意：1.妥善保管好自己的身份证件、银行卡、网银U盾、手机，不借给他人使用，一旦丢失要立即挂失；2.开通银行账户变动短信提醒，仔细核对交易业务类型、交易商户和金融是否正确，关注账户变动情况，定期检查账户资金交易明细和余额；3.谨慎取款和消费，不要随意丢弃银行卡刷卡消费或使用ATM设备的交易凭条；4.不点击短信、网络聊天工具或网站中的可疑链接，不登录非法网站，慎扫不明来历的二维码；5.慎连免费Wi-Fi,链接免费Wi——FI时不登录网上银行、手机银行、支付机构APP进行账户查询、支付等操作；6.妥善设置银行卡密码，不使用同一数字、生日、身份证号码等容易被猜测的简单密码，不将银行卡密码作为其他网站、APP的密码，多张银行卡不使用同一密码，并定期更改银行卡密码；7.将银行卡磁条卡更换为芯片卡。\r\n如果持卡人发现有伪卡交易和账户盗用等非本人授权交易时，建议第一时间与发卡机构取得联系，冻结、挂失卡片，避免再次遭受盗刷，同时在发卡机构的指导下留存证据，按照相关规则进行差错争议处理。\r\n（三）了解客户备付金，防范支付账户风险\r\n1. 正确认识客户备付金的本质\r\n客户备付金是支付机构预收其客户的待付货币资金，不属于支付机构的自有财产。客户备付金的所有权属于支付机构客户，但不同于客户的银行存款，不受《存款保险条例》保护，也不以客户名义存放在银行，而是以支付机构名义存放在银行，并由支付机构向银行发起资金挑拨指令。\r\n客户备付金的规模巨大、存放分散，存在一些列风险隐患。中国人民银行建立支付机构客户备付金集中存管制度，主要目的是纠正和防止支付机构挪用、占用客户备付金，保障客户资金安全，并引导支付机构回归业务本源。\r\n2.支付账户的风险防范\r\n（1）审慎选择支付机构。客户应该适当关注支付机构披露的信息，选择服务机制完善、业务风险较低的支付机构办理业务。\r\n（2）妥善保管本人或本单位信息。客户在开立支付账户、办理支付业务过程中药妥善保管个人或单位信息以及相关证件，并留意支付机构对收集目的和用途的说明，避免信息泄露。\r\n（3）准确辨识服务渠道的真实性。客户应该留意支付机构网站地址、客户电话等服务渠道，准确辨识服务渠道的真实性，避免支付账户名称和密码、手机动态验证码等敏感信息被不发分子通过“钓鱼”手段窃取。\r\n（4）积极维护自身权益。客户使用支付账户办理支付业务过程中一旦发生风险损失，如果支付机构不能有效证明风险损失是因客户原因导致的，那么支付机构需要对客户的损失及时先行全额赔付。\r\n \r\n二、保障金融消费者基本权利\r\n2015年11月14日，国务院办公厅发布了《关于加强金融消费者权益保护工作的指导意见》，明确了金融机构消费者权益保护工作的行为规范，要求金融机构充分尊重并自觉保障金融消费者的财产安全权、知情权、自主选择权、公平交易权、受教育权、信息安全权等基本权利，依法、合规开展经营活动。这是首次从国家层面对金融消费权益保护进行具体规定，强调保障金融消费者的八项权利。\r\n（一）保障金融消费者财产安全权\r\n金融机构应当依法维护金融消费者在购买金融产品和接受金融服务过程中的财产安全。金融机构应当审慎经营，建立严格的内控措施和科学的技术监控手段，严格区分机构自身资产和客户资产，不得挪用、占用客户资金。\r\n（二）保障金融消费者知情权\r\n金融机构应当以通俗易懂的语言，及时、真实、准确、全面地向金融消费者披露可能影响其决策的信息，充分提示风险，不得发布夸大产品收益、掩饰产品风险等欺诈信息，不得作虚假或引人误解的宣传。\r\n（三）保障金融消费者自主选择权\r\n金融机构应在法律法规和监管规定允许范围内，充分尊重金融消费者意愿，由消费者自主选择、自行决定是否购买金融产品或接受金融服务，不得强买强卖，不得违背金融消费者意愿搭售产品和服务，或不得附加其他不合理的条件，不得采用引人误解的手段诱使金融消费者购买其他产品。\r\n（四）保障金融消费者公平交易权\r\n金融机构不应设置违反公平原则的交易条件，在格式合同中不得加重金融消费者责任、限制或者排除其合法权利，不得限制金融消费者寻求法律救济途径，不得减轻、免除本机构损害金融消费者合法权益应当承担的民事责任。\r\n（五）保障金融消费者依法求偿权\r\n金融机构应当切实履行金融消费者投诉处理主体责任，在机构内部建立多层级投诉处理机制，完善投诉处理程序，建立投诉办理情况查询系统，提高金融消费者投诉处理质量和效率，接受社会监督。\r\n（六）保障金融消费者受教育权\r\n金融机构应进一步强化金融消费者教育，积极组织或参与金融知识普及活动，开展广泛、持续的日常性金融消费者教育，帮助金融消费者提高对金融产品和服务的认知能力及自我保护能力，提升金融消费者金融素养和诚实守信意识。\r\n（七）保障金融消费者受尊重权\r\n金融机构应尊重金融消费者的人格尊严和民族风俗习惯，不因金融消费者的性别、年龄、种族、民族或国籍等不同而进行歧视性差别对待。\r\n（八）保障金融消费者信息安全权\r\n金融机构应当采取有效措施加强对第三方合作机构管理，明确双方权利义务关系，杨哥防控金融消费者信息泄露风险，保障金融消费者信息安全。\r\n \r\n三、规范金融机构行为\r\n为了规范金融机构行为，保障金融消费者合法权益，中国人民银行与2016年12月14人制定印发了《中国人民银行金融消费者权益保护实施办法》。其中，与金融消费者利益密切相关的有以下条款。\r\n（一）关于信息披露的内容\r\n信息披露是保障金融消费者知情权的重要手段，金融机构应当披露的内容包括：金融消费者对该金融产品和服务的权利和义务，订立、变更、中止和接触合同的方式及限制；金融机构对该金融产品和服务的权利、义务及法律责任；金融消费者应当负担的费用及违约金，包括金额的确定、支付十点和方式；金融产品和服务发生纠纷的处理及投诉途径；其他法律法规或监管规定就各类金融产品和服务所要求的应当定期或不定期披露或报告的事项及其他应当说明的事项。同时金融机构应当提示金融消费者不得利用金融产品和服务从事违法活动。\r\n（二）关于营销禁止的内容\r\n金融机构在营销活动中应当遵循诚信原则，不得侵害金融消费者所销售的八项权利，尤其不得有一下行为：虚假、欺诈、隐瞒或引人误解的宣传；损害其他同业声誉；冒用、使用与他人相同或相近的注册商标、宣传册页，有可能使金融消费者混淆；对业绩或者产品收益等夸大宣传；利用金融管理部门对金融产品和服务的审核或者备案程序，误导金融消费者认为金融管理部门已对该金融产品和服务提供保障；对未按要求经金融管理部门核准或者备案的金融产品和服务进行预先宣传或者促销；非保本投资型金融产品营销内容使金融消费者误信能保证本金安全或者保证盈利；未通过足以引起金融消费者注意的文字、符号、字体等特别标识对限制金融消费者权利的事项进行说明；其他违反消费者权益保护相关法律法规和监管规定的行为。\r\n（三）关于文本管理和格式条款的内容\r\n金融消费者在购买金融产品和服务时，不可避免地会与合同文本打交道，金融机构在的格式合同及服务协议文本，不得存在误导、欺诈等侵犯金融消费者合法权益的内容；不得含有减轻、免除己方责任，加重金融消费者责任，限制或者排除金融消费者合法权益的格式条款，及借助技术手段强制交易等不合理条款。同时，金融机构在提供金融产品和服务的过程中，不得通过附加限制性条件的方式要求金融消费者购买协议中未作明确要求的产品和服务。\r\n（四）关于个人金融信息保护的内容\r\n个人金融信息与金融消费者的权益息息相关，金融机构在收集个人金融信息时，应当遵循合法、合理、必要原则，按照法律法规要求和业务需要收集个人金融信息，不得收集与业务无关的信息或者采取不正当方式收集信息，不得非法存储个人金融信息；应当采取符合国家档案管理和电子数据管理规定的措施，妥善保管所收集的个人金融信息，防止信息遗失、损毁、泄露或者篡改。在发生或者可能发生个人金融信息遗失、损坏、泄露或者篡改等情况时，应当立即采取补救措施，及时告知用户并向有关主管部门报告。同时，金融机构及其相关工作人员应对业务过程中知悉的个人金融信息予以保密，不得非法复制、非法存储、非法使用、向他人出售或者以其他非法形式泄露个人金融信息。',1,'100','',1490971460,1),(18,2,'微信支付通道已重整上线','微信支付手续费扫码2% 有问题联系客服',1,'100','',1492413560,1),(19,2,'平台升级维护通知','<span style=\"white-space:nowrap;\">随着平台商户日益增加，经平台管理层研究决定，将于2016年3月5日 0:00点至7:00点进行系统升级维护。</span><br />\r\n<p>\r\n	<span style=\"white-space:nowrap;\">受此影响，维护期间将暂停 支付功能、商户中心登陆及操作和平台提现功能；</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">开户实名认证等操作时会出现失败情况，请避开该时段进行以上操作。</span> \r\n</p>\r\n<span style=\"white-space:nowrap;\">由此给您带来的不便敬请谅解，感谢您的支持。</span><br />',1,'100','',1504103481,1),(20,2,'聚合通全面升级，现已支持 多种收款方式','<span style=\"white-space:nowrap;\">无卡支付：客户有银行卡，并没有开通网银。</span><br />\r\n<p>\r\n	<span style=\"white-space:nowrap;\">信用卡支付：不限额，支付最大金额按对应信用卡所在银行限额情况。</span> \r\n</p>\r\n<span style=\"white-space:nowrap;\">网银：客户储蓄卡开通了网上银行支付功能。</span><br />\r\n<p>\r\n	<span style=\"white-space:nowrap;\">微信支付：第三方支付方式，只能用于微信。</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">消费者可以通过微信直接打开付款或扫一扫付款</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">支付宝支付：第三方支付方式，只能用于支付宝。</span> \r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">消费者可以通过支付宝APP直接扫一扫或打开支付宝网页付款。</span> \r\n</p>',1,'100','',1504103741,1),(23,2,'紧急通知，我司提现调整','<p>\r\n	<span style=\"white-space:nowrap;\">紧急通知，我司提现调整，马上将开放T0秒结</span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">2017/9/6开始晚上不结算</span><span style=\"white-space:nowrap;\">第二天</span><span style=\"white-space:nowrap;\">早上9点统一</span>\r\n</p>\r\n<p>\r\n	<span style=\"white-space:nowrap;\">到账。</span><span style=\"white-space:nowrap;\">早上结算，直到开通T0秒结以后关闭！</span>\r\n</p>',1,'100','',1504702971,1),(24,2,'全国支付大检查已经行动，我司大力协助调查，违规直接封！','<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">最近上海人民银行的对于辖区内的</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">支付机构展开大规模的违规处罚工作，</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">归属上海分行主管的本地注册持牌支付机构共有47家，</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">（原有53家，因为违规被注销和合并共取消6家）</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">截至前共有41家已经收到了罚单，多家知名支付公司都被处罚，</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">包括支付宝的首张罚单也是上海人行开出，</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">（支付宝原注册在杭州，后移到上海归属上海人行主管）</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">处罚比例高达近90%的支付公司收到罚单，特别是整个</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\"><strong style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;\"><span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;color:#FF2941;\">8月份一个月就开出34张罚单，罚单速度之快，</span></strong></span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\"><strong style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;\"><span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;color:#FF2941;\">面积之广算是行业罕见</span></strong>，从处罚情况来看也</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">可见央行的对于支付机构监管决心和态度，</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">同时也能反应出支付行业存在问题具有普遍性，</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">如果不严格管理或引发更大风险！</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;line-height:25.6px;white-space:normal;widows:1;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"><br />\r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;line-height:25.6px;white-space:normal;widows:1;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"><br />\r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\">近日中国人民银行支付结算司司长谢众发文表示</span> \r\n</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;background-color:#ffffff;box-sizing:border-box=\"\" !important;\"=\"\"> <span style=\"margin:0px;padding:0px;max-width:100%;box-sizing:border-box !important;word-wrap:break-word !important;font-size:14px;\"> 人民银行以“守住不发生系统性金融风险的底线”为目标，</span> \r\n	</p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;max-width:100%;clear:both;min-height:1em;color:#3E3E3E;font-family:\" font-size:16px;white-space:normal;widows:1;line-height:2em;bac